description:
Category	Feature, Couples

Director	Stormy Daniels
Starring	Anikka Albrite, Danny Mountain, Eric Masterson, Ryan McLane, Brooklyn Chase, Kleio Valentien, Bradley Remington, Ela Darling, Jay Smooth

Kristin (Anikka Albrite) is an aspiring actress. When she lands a role on a TV show thanks to her uncle, she really hopes that it will be her big break. Unfortunately the cast is not very welcoming and her jealous boyfriend is unsupportive. As she struggles to prove herself, Kristin finds herself falling for the male lead. With the help of the show's crew and and her best friend, Kristin soon discovers what goes down behind the scenes is sometimes even more important than what happens onscreen.
